import React, { useState } from "react";
import { createComponent } from "react-fela";
import Link from "next/link";
import { HeadingMedium } from "./StyledText";

const navigation = ({ color = "black" }) => ({
  font: "26px/30px Georgia, serif",
  padding: "0 0 16px 0",
  margin: 0,
  color
});

export const HeadingLarge = createComponent(headingLarge, "h1");

const Navigation = ({ animations }) => (
  <nav>
    <HeadingMedium>Animation Library </HeadingMedium>
    <div>
      <button> V </button>
      <div>
        {animations.map(item => (
          <li>
            <Link href={`/${item.animationKey}`}>{item.animationName}</Link>
          </li>
        ))}
      </div>
    </div>
  </nav>
);

export default Navigation;
